#include <limits.h>

int minSizeSubarray(int* nums, int numsSize, int target) {
    int sum = 0;
    for (int i = 0; i < numsSize; ++i) {
        sum += nums[i];
    }

    if (sum == target) return numsSize;
    if (sum < target) return -1;

    int minLen = INT_MAX, currentSum = 0;
    for (int i = 0, j = 0; i < 2 * numsSize; ++i) {
        currentSum += nums[i % numsSize];
        while (currentSum - (i - j >= numsSize ? nums[j % numsSize] : 0) >= target) {
            currentSum -= nums[j % numsSize];
            ++j;
        }
        if (currentSum >= target) {
            minLen = minLen < i - j + 1 ? minLen : i - j + 1;
        }
    }

    return minLen == INT_MAX ? -1 : minLen;
}
